  true,\n\t\"url\": null,\n\t\"notes\": \"The Livestock and Meat Trade Data Set contains
  monthly and annual data for imports and exports of live cattle, hogs, sheep, and
  goats, as well as beef and veal, pork, lamb and mutton, chicken meat, turkey meat,
  and eggs. The tables report physical quantities, not dollar values or unit prices.
  Data on beef and veal, pork, and lamb and mutton are on a carcass-weight-equivalent
  basis. Breakdowns by country are included.\",\n\t\"license_title\": \"Creative Commons
